import React, { useState } from 'react'
import axios from 'axios'

//
//course with paramter


export default function Course({course_id}) {
    const [data, setData] = useState([])


    axios.get('http://localhost:5000/course/' + course_id)
    .then(res => {
        console.log(res.data)
        setData(res.data)
    })
    .catch(err => {
        console.log(err)
    })

    return (    
        <div className="course">
            <h1>Course</h1>
            <ul>
                {data.map((item, index) => {
                    return <li>{item.title} {item.credits}</li>

                })}


            </ul>

        </div>
    )

}
